import { GET_COMMENT } from './types';
import axios from 'axios';


export const getComments = () => async dispatch => {

    console.log(localStorage.getItem("token"));
 
    await axios
        .get('http://localhost:5000/cities/all', )
        .then(res => dispatch({
            type: GET_CITIES,
            payload: res.data
        }))
}
